import React from "react";
import Product from "./Product";

const Home = () => {
  return (
    <div>
      <div className="hero">
        <div className="card bg-dark text-white border-0">
          <img
            src="https://volsiz.ru/wp-content/uploads/2021/12/amazon-840x400.jpg"
            className="card-img"
            alt="Background"
          />
        </div>
      </div>
      <Products />
    </div>
  );
};

export default Home;
